CREATE DEFINER=`lamitj19gu`@`localhost` PROCEDURE `bibliaStar` ()   BEGIN

set @rank = 0;
set @val = 0;
set @cat := '';
set @inv_rnk := '';
set @inv_grd := '';
set @grp_rnk := '';
set @grp_grd := '';

DROP TABLE IF EXISTS `idv_table`;
DROP TABLE IF EXISTS `grp_table`;
DROP TABLE IF EXISTS `biblia_table`;

CREATE TEMPORARY TABLE idv_table (CATEGORY VARCHAR(255), FULL_NAME VARCHAR(255), PARISH VARCHAR(255), FORANE VARCHAR(255), rkpoint INT(15), grdpoint INT(15), points INT(15));
CREATE TEMPORARY TABLE grp_table (FULL_NAME VARCHAR(255), PARISH VARCHAR(255), FORANE VARCHAR(255), rkpoint INT(15), grdpoint INT(15), points INT(15));
CREATE TEMPORARY TABLE biblia_table (CATEGORY VARCHAR(255), FULL_NAME VARCHAR(255), PARISH VARCHAR(255), FORANE VARCHAR(255), idv_rkpoint INT(15), idv_grdpoint INT(15), idv_points INT(15), grp_rkpoint INT(15), grp_grdpoint INT(15),  grp_points INT(15));

SELECT e.CATEGORY, 
        md.FULL_NAME, 
        md.PARISH, 
        md.FORANE, 
        SUM(md.RANK_POINTS) as i_rkpoint, 
        SUM(md.GRADE_POINTS) as i_grdpoint, 
        SUM(md.POINTS) as i_points FROM `master_data` md 
JOIN `events` e on e.SECTION = md.SECTION AND e.STATUS='PUBLISHED' 
        WHERE e.CATEGORY <> 'Group' 
        GROUP BY CATEGORY, FULL_NAME, PARISH, FORANE 
        ORDER BY SUM(md.RANK_POINTS) DESC, SUM(md.GRADE_POINTS) DESC, SUM(md.POINTS) DESC;

SELECT gd.FULL_NAME, 
        gd.PARISH, 
        gd.FORANE, 
        SUM(gmd.RANK_POINTS) as g_rkpoint, 
        SUM(gmd.GRADE_POINTS) as g_grdpoint, 
        SUM(gmd.POINTS) as g_points FROM `group_data` gd 
JOIN `master_data` gmd on gd.CHEST_NO = gmd.CHEST_NO 
GROUP BY gd.FULL_NAME, gd.PARISH, gd.FORANE;

SELECT idv.CATEGORY, idv.FULL_NAME, idv.PARISH, idv.FORANE, 
        idv.rkpoint AS idv_rkpoint,
        idv.grdpoint AS idv_grdpoint,
        idv.points  AS idv_points,
        ifnull(grp.rkpoint,0) AS grp_rkpoint,
        ifnull(grp.grdpoint,0) AS grp_grdpoint,
        ifnull(grp.points,0) AS grp_rkpoints
        -- idv.rkpoint + ifnull(grp.rkpoint,0), 
        -- idv.grdpoint + ifnull(grp.grdpoint, 0), 
        -- idv.points + ifnull(grp.points, 0)
FROM idv_table idv
        LEFT JOIN grp_table grp on grp.FULL_NAME = idv.FULL_NAME AND grp.PARISH = idv.PARISH AND grp.FORANE = idv.FORANE
ORDER BY idv.CATEGORY;

SELECT CATEGORY, FULL_NAME, PARISH, FORANE, idv_rkpoint, idv_grdpoint, denseRANK
FROM (
        SELECT CATEGORY, FULL_NAME, PARISH, FORANE, idv_rkpoint, idv_grdpoint, grp_rkpoint, grp_grdpoint,
                @rank := if(@cat=CATEGORY, if(@inv_rnk=idv_rkpoint, if(@inv_grd=idv_grdpoint, if(@grp_rnk = grp_rkpoint, if(@grp_grd = grp_grdpoint, @rank, @rank + @val), @rank + @val), @rank + @val), @rank + @val), 1) as denseRank,
                @val := if(@cat=CATEGORY, 
                                if(@inv_rnk=idv_rkpoint, 
                                        if(@inv_grd=idv_grdpoint, 
                                                if(@grp_rnk = grp_rkpoint,
                                                        if(@grp_grd = grp_grdpoint, @val, @val + 1),
                                                        @val + 1),
                                                @val + 1),
                                        @val + 1),
                                1) as value,
                @cat := CATEGORY,
                @inv_rnk := idv_rkpoint,
                @inv_grd := idv_grdpoint,
                @grp_rnk := grp_rkpoint,
                @grp_grd := grp_grdpoint
        FROM (SELECT CATEGORY, FULL_NAME, PARISH, FORANE, idv_rkpoint, idv_grdpoint, grp_rkpoint, grp_grdpoint FROM biblia_table ORDER BY CATEGORY ASC, idv_rkpoint DESC, idv_grdpoint DESC, grp_rkpoint DESC, grp_grdpoint DESC) A ORDER BY CATEGORY ASC, idv_rkpoint DESC, idv_grdpoint DESC, grp_rkpoint DESC, grp_grdpoint DESC
) B WHERE denseRANK=1 ORDER BY CATEGORY, denseRANK;

END$$

CREATE DEFINER=`lamitj19gu`@`localhost` PROCEDURE `denseRank` (IN `P_SECTION` VARCHAR(255))   BEGIN

set @rn1 =0;
set @sal ='';
set @val =0;

SELECT  id, marks, denseRank FROM (
        SELECT  id, marks,
                @rn1 := if(@sal=marks, @rn1, @rn1+1) as denseRank,
                @val := if(@sal=marks, @val+1, 1) as value,
                @sal := marks
        FROM (SELECT  id, section, marks FROM `master_data` WHERE SECTION = P_SECTION ORDER BY MARKS DESC) A ORDER BY MARKS DESC
    ) B ORDER BY MARKS DESC;
       
END$$

CREATE DEFINER=`lamitj19gu`@`localhost` PROCEDURE `findGradePoints` (IN `F_SECTION` VARCHAR(255))   BEGIN

UPDATE `master_data` SET MARKS=(JUDGE_1 + JUDGE_2 + JUDGE_3),
	GRADE = (CASE 
       WHEN ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 240) THEN ('A')
       WHEN (((JUDGE_1 + JUDGE_2 + JUDGE_3) < 240) AND ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 225)) THEN 'B'
       WHEN (((JUDGE_1 + JUDGE_2 + JUDGE_3) < 225) AND ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 210)) THEN 'C'
       ELSE '-' END),
    GRADE_POINTS = (
					CASE 
						WHEN (SECTION LIKE '%-G%') THEN
							CASE 
								WHEN ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 240) THEN 10
								WHEN (((JUDGE_1 + JUDGE_2 + JUDGE_3) < 240) AND ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 225)) THEN 5
								WHEN (((JUDGE_1 + JUDGE_2 + JUDGE_3) < 225) AND ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 210)) THEN 3
								ELSE 0 
							END
						ELSE
							CASE 
								WHEN ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 240) THEN 5
								WHEN (((JUDGE_1 + JUDGE_2 + JUDGE_3) < 240) AND ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 225)) THEN 3
								WHEN (((JUDGE_1 + JUDGE_2 + JUDGE_3) < 225) AND ((JUDGE_1 + JUDGE_2 + JUDGE_3) >= 210)) THEN 1
								ELSE 0 
							END
						END							
					)
WHERE SECTION = F_SECTION AND STATUS='PRESENT';

commit;

END$$

CREATE DEFINER=`lamitj19gu`@`localhost` PROCEDURE `rankPointUpdate` (IN `P_SECTION` VARCHAR(255))   BEGIN

update `master_data` SET
	RANK_POINTS = (
		CASE
			WHEN (SECTION LIKE '%-G%') THEN
				CASE 
					WHEN (RANK = 1) THEN 10
					WHEN (RANK = 2) THEN 5
					WHEN (RANK = 3) THEN 3
					ELSE 0 
				END
			ELSE
				CASE 
					WHEN (RANK = 1) THEN 5
					WHEN (RANK = 2) THEN 3
					WHEN (RANK = 3) THEN 1
					ELSE 0 
				END
			END
    )
WHERE SECTION = P_SECTION AND STATUS='PRESENT';

END$$

CREATE DEFINER=`lamitj19gu`@`localhost` PROCEDURE `rankupdate` (IN `P_SECTION` VARCHAR(255))   BEGIN

set @rn1 =0;
set @sal ='';
set @val =0;

DROP TABLE IF EXISTS `ranktable`;

CREATE TEMPORARY TABLE ranktable (ID VARCHAR(15),RANKVAL INT(10));

SELECT  id, denseRank FROM (
        SELECT  id, marks,
                @rn1 := if(@sal=marks, @rn1, @rn1+1) as denseRank,
                @val := if(@sal=marks, @val+1, 1) as value,
                @sal := marks
        FROM (SELECT  id, section, marks FROM `master_data` WHERE SECTION = P_SECTION AND STATUS='PRESENT' ORDER BY MARKS DESC) A ORDER BY MARKS DESC
    ) B ORDER BY MARKS DESC;
       
UPDATE `master_data` md SET md.RANK = (SELECT RANKVAL FROM ranktable rk WHERE md.id = rk.id) WHERE SECTION=P_SECTION AND STATUS='PRESENT';

END$$

CREATE DEFINER=`lamitj19gu`@`localhost` PROCEDURE `totalPointsUpdate` (IN `P_SECTION` INT(255))   BEGIN
  
update `master_data` SET
	POINTS = RANK_POINTS + GRADE_POINTS
WHERE SECTION = P_SECTION AND STATUS='PRESENT';

commit;

END$$

